import * as React from "react";
import { styled, alpha } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import InputBase from "@mui/material/InputBase";
import SearchIcon from "@mui/icons-material/Search";
import { useState } from "react";
import { fetchTracks } from "../../api/track/trackApi";
import { GetModel } from "../../api/track/models/CreateTrack";
import { Track } from "../../api/track/models/Track";
import { PageList } from "../../types/PageList";
import { Typography } from "@mui/material";

const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha("#3E2723", 0.1),
  "&:hover": {
    backgroundColor: alpha("#3E2723", 0.2),
  },
  marginLeft: 0,
  width: "100%",
  [theme.breakpoints.up("sm")]: {
    marginLeft: theme.spacing(1),
    width: "auto",
  },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: "100%",
  position: "absolute",
  pointerEvents: "none",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  color: "#3E2723",
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: "#3E2723",
  width: "100%",
  "& .MuiInputBase-input": {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create("width"),
    [theme.breakpoints.up("sm")]: {
      width: "12ch",
      "&:focus": {
        width: "20ch",
      },
    },
  },
}));

type Props = {
  onSearch: (results: PageList<Track>) => void;
};

export const SearchAppBar: React.FC<Props> = ({ onSearch }) => {
  const [input, setInput] = useState("");
  const [allTracks, setAlltracks] = useState<Track[]>([]);
  const [searchResults, setSearchResults] = useState<PageList<Track> | null>(
    null
  );

  const searchTrack = async (value: string) => {
    setInput(value);

    const model: GetModel = {
      page: 1,
      limit: 100,
      sort: "",
      search: value,
      genre: "",
      artist: "",
      order: "asc",
    };

    const response = await fetchTracks(model);

    if (response && response.data) {
      setAlltracks(response.data);
      setSearchResults(response);
      onSearch(response);
    } else {
      setSearchResults({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
      onSearch({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
    }
  };

  return (
    <Box
      sx={{
        width: "100%",
        maxWidth: 800,
        mx: "auto",
        mt: 4,
        px: { xs: 2, sm: 3 },
      }}
    >
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          background: "rgba(255, 255, 255, 0.6)",
          backdropFilter: "blur(16px)",
          borderRadius: 6,
          px: { xs: 2, sm: 3 },
          py: { xs: 1.5, sm: 2 },
          boxShadow: "0 8px 30px rgba(99, 102, 241, 0.1)",
          border: "1px solid rgba(99, 102, 241, 0.2)",
          transition: "all 0.35s ease",
          "&:hover": {
            boxShadow: "0 10px 40px rgba(99, 102, 241, 0.18)",
            transform: "translateY(-2px)",
          },
          "&:focus-within": {
            border: "1px solid rgba(99, 102, 241, 0.5)",
            boxShadow:
              "0 12px 50px rgba(99, 102, 241, 0.25), 0 0 0 2px rgba(99, 102, 241, 0.15)",
            transform: "translateY(-3px) scale(1.01)",
          },
        }}
      >
        {/* Search Icon */}
        <SearchIcon
          sx={{
            fontSize: 28,
            mr: 2,
            color: "rgba(99, 102, 241, 0.9)",
            transition: "all 0.3s ease",
          }}
        />

        {/* Input */}
        <InputBase
          placeholder="Search tracks, artists, albums..."
          value={input}
          onChange={(e) => setInput(e.target.value)}
          onKeyDown={async (e) => {
            if (e.key === "Enter") {
              const value = (e.target as HTMLInputElement).value;
              await searchTrack(value);
            }
          }}
          sx={{
            flex: 1,
            fontSize: { xs: "1rem", sm: "1.05rem" },
            fontWeight: 500,
            color: "#1f2937",
            "& input": {
              padding: 0,
              "&::placeholder": {
                color: "#9ca3af",
                fontWeight: 400,
              },
            },
          }}
        />

        {/* Enter hint */}
        {input && (
          <Box
            sx={{
              display: { xs: "none", sm: "flex" },
              alignItems: "center",
              gap: 0.5,
              px: 1.5,
              py: 0.8,
              borderRadius: 2,
              background: "linear-gradient(135deg, #6366f1, #8b5cf6)",
              boxShadow: "0 3px 12px rgba(99, 102, 241, 0.3)",
              ml: 1.5,
              animation: "fadeIn 0.3s ease",
              "@keyframes fadeIn": {
                from: { opacity: 0, transform: "translateY(3px)" },
                to: { opacity: 1, transform: "translateY(0)" },
              },
            }}
          >
            <Typography
              variant="caption"
              sx={{
                color: "#fff",
                fontWeight: 700,
                fontSize: "0.75rem",
              }}
            >
              Enter
            </Typography>
            <Typography sx={{ color: "#fff", fontSize: "0.9rem" }}>
              ↵
            </Typography>
          </Box>
        )}
      </Box>
    </Box>
  );
};
